import  { useState } from "react";

import { useSelector, useDispatch } from "react-redux";
import{ getOrder, getPokemonName,buscarTipos}from '../Store/action'

 

export default function Buscar() {
  const dispatch = useDispatch();
  const [pokemons, setPokemons] = useState("");

  const options = useSelector((store) => store.pokemon.pokemons.types);
  console.log(options)

  const handleInputChange = (e) => {
    setPokemons(e.target.value);
  };
 // quedamos por aqui
    const byTipo = (e) => {
    console.log(e.target.value)
    dispatch(buscarTipos(e.target.value))
   }
  
  const submit = (e) => {
    e.preventDefault();
    dispatch(getPokemonName(pokemons));
    setPokemons("");
  };

  const sele = (e) => {
    console.log(e.target.value)
    
  }

  const order = (e) => {
    const num=e.target.value
    console.log(num)
     dispatch(getOrder(num));
   }
   const siguiente = () => {
      
   }
 
  return (
    <div >
      <form onSubmit={submit}>
        <div >
          <input
            type="text"
            
            value={pokemons}
            onChange={handleInputChange}
            placeholder="P O K E M 0 N S"
          />
          <input type="submit" value="Buscar" />
        </div>
        <button>atras</button>
        <button onChange={siguiente}>siguiente</button>
      </form>
      <div>
        <select  name="Type" onChange={byTipo}>
          <option value="">Tipo:</option>
          <option value="normal">normal</option>
          <option value="fighting">fighting</option>
          <option value="flying">flying</option>
          <option value="poison">poison</option>
          <option value="ground">ground</option>
          <option value="rock">rock</option>
          <option value="bug">bug</option>
          <option value="ghost">ghost</option>
          <option value="steel">steel</option>
          <option value="fire">fire</option>
          <option value="water">water</option>
          <option value="grass">grass</option>
          <option value="electric">electric</option>
          <option value="psychic">psychic</option>
          <option value="ice">ice</option>
          <option value="dragon">dragon</option>
          <option value="dark">dark</option>
          <option value="fairy">fairy</option>
          <option value="unknown">unknown</option>
          <option value="shadow">shadow</option>
          
        </select>
        <select name="creado" onChange={sele}>
          <option value="1">API</option>
          <option value="2">BASE-DATOS</option>
          <option value="3">ALL</option>
        </select>
        <select name="Ordenar"  onChange={order}>
          <option value="">Ordenar</option>
          <option value="A-Z">Z-A</option>
          <option value="Z-A">A-Z</option>
          <option value="fuerza+">MAX-FUERZA</option>
          <option value="fuerza-">MIN-FUERZA</option>
        </select>
      </div>
    </div>
  )
}
